// export default SideNav;



const SideNav = () => {
  const [currentProgress, setCurrentProgress] = useState(0);
  
  useEffect(() => {
    const storedProgress = localStorage.getItem('progress');
    if (storedProgress) {
      setCurrentProgress(parseInt(storedProgress));
    }
  }, []);

  const handleButtonClick = (increment) => {
    if (currentProgress >= increment) {
      return; // Do nothing if the progress bar is already at or beyond this increment
    }

    // Wait for 5 seconds before updating the progress
    setTimeout(() => {
      setCurrentProgress(increment);
      localStorage.setItem('progress', increment);
    }, 5000);
  };

  const handleRefreshButtonClick = () => {
    setCurrentProgress(0);
    localStorage.setItem('progress', 0);
  };

  return (
    <div className="app-side-nav">
      <nav className="side-nav-content">
        <ul className="nav-list">
          <li className="nav-list-item">
            <span>
              <Link to="/dashboard"><span style={{ color: 'black' }}>Progress</span></Link>
            </span>
            <ProgressBar currentProgress={currentProgress} totalItems={5} />
          </li>
          <li className="nav-list-item">
            <span>
              <Link to="/dashboard/project" onClick={() => handleButtonClick(1)}>ACFC Overview</Link>
            </span>
          </li>
          <li className="nav-list-item">
            <span>
              <Link to="/dashboard/domainnew" onClick={() => handleButtonClick(2)}>Domain Foundation</Link>
            </span>
          </li>
          <li className="nav-list-item">
            <span>
              <Link to="/dashboard/edoprod" onClick={() => handleButtonClick(3)}>Mandatory Trainings</Link>
            </span>
          </li>
          <li className="nav-list-item">
            <span>
              <Link to="/dashboard/deep" onClick={() => handleButtonClick(4)}>Deep Dive Session</Link>
            </span>
          </li>
          <li className="nav-list-item">
            <span>
              <Link to="" onClick={handleButtonClick}>Quiz</Link>
            </span>
          </li>
          <li className="nav-list-item">
            <span>
              <Link to="" onClick={handleRefreshButtonClick}>Refresh</Link>
            </span>
          </li>
        </ul>
        <ul className="bottom-nav-list">
          <li className="bottom-nav-list-item">
            <a href="https://tensaigpt.hexaware.com/" target="_blank" rel="noopener noreferrer">
              <img src="https://github.com/Guruprasad-suvarna/Tensai/assets/83869639/6fb21de8-d7b1-4fa8-bee9-40a42072dcbe" alt="Tensai GPT Icon" />
            </a>
          </li>
        </ul>
      </nav>
      <Outlet />
    </div>
  );
};

export default SideNav;
